import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';
import header1 from '../assets/images/people/header_photo.jpg';
import header2 from '../assets/images/people/header_photo2.jpg';

const items = [
  {
    src: "../assets/images/people/header_photo.jpg",
  },
  {
    src: '../assets/images/people/header_photo2.jpg',
    altText: 'Slide 3',
    caption: 'Slide 3',
    header: 'Slide 3 Header'
  }
];

const AboutCarousel = () => <UncontrolledCarousel items={items} />;

export default AboutCarousel;
